import fetch from 'isomorphic-unfetch'


export const postsApi = {

	getAllPosts() {
        try {
            return	fetch('http://localhost:3000/posts/all')
            .then(res => res.json())
            .then(res => res.data)
        }catch (err){
            console.log(`some error ${err.message}`)
        }
	 }
};
